INSERT INTO `currency_types_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(3319, 'koKR', '황혼의 칼날단 휘장', '황혼의 칼날단에 입회할 때 주어지는 물건입니다. 황혼의 고원 승천 기지에 있는 상인이 이교도 활동을 타도하려는 노력의 증거로 받아들일 것입니다.', 65727),
(3356, 'koKR', '정순한 마나 수정', '구렁 탐험가의 여정 9 등급을 달성한 후 획득할 수 있습니다. 11 레벨의 풍요로운 구렁에서 복원된 금고 열쇠로 풍요로운 금고를 열어 획득합니다. 자흐란을 통해 강력한 장비로 교환할 수 있습니다.', 65727),
(2803, 'koKR', '지하의 주화', '탐험가들이 비밀이나 금은보화와 관련된 풍문을 교환할 때 흔히 사용하는 화폐입니다.', 65727);
