(2801, 'koKR', '어둠의 심장부', '마나괴철로 종극점의 심장부까지 길을 열어 어둠의 화신이자 만물의 포식자 디멘시우스와 결판을 내야 합니다.', 65727),
(2800, 'koKR', '모래의 괴물', '디멘시우스를 소환하려는 제련직공 아라즈를 저지한 후, 마나괴철로 종극점의 그늘 아래 숨겨진 위험천만한 사막으로 빠져나가야 합니다.', 65727),
(2799, 'koKR', '어둠수호병의 힘', '마나괴철로 종극점의 심장부로 접근해 어둠수호병의 음모를 분쇄해야 합니다.', 65727),
