(2783, 'koKR', '크롬왕', '치명적인 발명품과 함께 기다리는 크롬왕 갤리윅스의 비밀 실험실에서 결판을 내야 합니다.', 65727),
(2782, 'koKR', '머리 하나보다는 둘', '머그지를 거치지 않고는 누구도 크롬왕 갤리윅스에게 갈 수 없습니다.', 65727),
(2781, 'koKR', '광기의 기계공', '스틱스 벙크정커는 고철장의 주인으로, 쓰레기를 대량 살상 무기로 바꿔버립니다.', 65727),
