(2713, 'koKR', '아미드랏실의 운명', '피락이 기어코 아미드랏실의 심장에 도달해 그 힘을 흡수하려 하고 있습니다.', 65727),
(2712, 'koKR', '녹빛 직조', '니무에는 에메랄드의 꿈을 구성하는 현혹적인 형식을 엮어내는 존재입니다. 하지만 용사들이 진입하면서 형식이 어지러워졌고, 니무에는 대응에 나섰습니다.', 65727),
(2711, 'koKR', '불타는 습격', '화염의 힘으로 뒤틀려 버린 라로다르는 에메랄드의 꿈을 불길로 뒤덮으려 하고 있습니다. 성공한다면 모든 게 잿더미가 되어버릴 것입니다.', 65727),
(2710, 'koKR', '현신의 자취', '스몰데론이 길을 헤치고 에메랄드의 꿈에 공세를 개시했습니다. 이를 견제하지 않으면 스몰데론의 병력이 모든 것을 닥치는 대로 불태울 것입니다.', 65727),
(2709, 'koKR', '공허의 가장자리', '사카레스는 심연의 경계에 서서 넬타리온의 힘을 차지하고, 전대 대지의 수호자의 유산을 손에 넣으려 하고 있습니다.', 65727),
(2708, 'koKR', '넬타리온의 어둠', '대지의 수호자를 타락시켰던 존재가... 어둠 속에서 새로운 희생양에게 마수를 뻗칩니다.', 65727),
(2707, 'koKR', '거인의 분노', '자칼리 전투단이 도가니를 향한 대대적인 공세를 개시했습니다. 이들은 앞길을 가로막는 모든 것을 파괴할 것입니다.', 65727),
(2706, 'koKR', '폭풍의 격노', '라자게스의 격노가 그녀의 형제자매들이 갇힌 감옥을 파괴하려 하고 있습니다. 라자게스가 성공한다면 현신들이 아제로스를 혼란의 도가니에 빠뜨릴 것입니다.', 65727),
(2705, 'koKR', '주입의 동굴', '쿠로그 그림토템이 자신에게 대항하는 모든 이에게 파멸을 선사하고자 막강한 정령을 불러낼 준비를 하고 있습니다.', 65727),
(2704, 'koKR', '버려진 작업물', '지난 수천 년 동안 버려져 있던 넬타리온의 피조물은 흉악한 무언가로 뒤틀려버렸습니다.', 65727),
(2703, 'koKR', '원시의 보루', '원시 의회가 산 내부에서 방어를 더욱더 견고하게 강화하고 있습니다. 현신의 해방을 저지하려면 원시술사의 전열을 무너뜨려야 합니다.', 65727),
