(2469, 'koKR', '아미드랏실의 운명', '피락이 기어코 아미드랏실의 심장에 도달해 그 힘을 흡수하려 하고 있습니다.', 65727),
(2468, 'koKR', '불타는 습격', '화염의 힘으로 뒤틀려 버린 라로다르는 에메랄드의 꿈을 불길로 뒤덮으려 하고 있습니다. 성공한다면 모든 게 잿더미가 되어버릴 것입니다.', 65727),
(2467, 'koKR', '녹빛 직조', '니무에는 에메랄드의 꿈을 구성하는 현혹적인 형식을 엮어내는 존재입니다. 하지만 용사들이 진입하면서 형식이 어지러워졌고, 니무에는 대응에 나섰습니다.', 65727),
(2466, 'koKR', '현신의 자취', '스몰데론이 길을 헤치고 에메랄드의 꿈에 공세를 개시했습니다. 이를 견제하지 않으면 스몰데론의 병력이 모든 것을 닥치는 대로 불태울 것입니다.', 65727),
(2430, 'koKR', '무한의 여명', '', 65727),
(2402, 'koKR', '공허의 가장자리', '사카레스는 심연의 경계에 서서 넬타리온의 힘을 차지하고, 전대 대지의 수호자의 유산을 손에 넣으려 하고 있습니다.', 65727),
(2401, 'koKR', '넬타리온의 어둠', '대지의 수호자를 타락시켰던 존재가... 어둠 속에서 새로운 희생양에게 마수를 뻗칩니다.', 65727),
(2400, 'koKR', '거인의 분노', '자칼리 전투단이 도가니를 향한 대대적인 공세를 개시했습니다. 이들은 앞길을 가로막는 모든 것을 파괴할 것입니다.', 65727),
(2399, 'koKR', '버려진 작업물', '지난 수천 년 동안 버려져 있던 넬타리온의 피조물은 흉악한 무언가로 뒤틀려버렸습니다.', 65727),
(2382, 'koKR', '주입의 전당', '', 65727),
(2381, 'koKR', '주입의 전당', '', 65727),
(2380, 'koKR', '담쟁이가죽 골짜기', '', 65727),
(2379, 'koKR', '담쟁이가죽 골짜기', '', 65727),
(2378, 'koKR', '노쿠드 공격대', '', 65727),
(2377, 'koKR', '노쿠드 공격대', '', 65727),
(2376, 'koKR', '루비 생명의 웅덩이', '', 65727),
(2375, 'koKR', '루비 생명의 웅덩이', '', 65727),
(2372, 'koKR', '폭풍의 격노', '라자게스의 격노가 그녀의 형제자매들이 갇힌 감옥을 파괴하려 하고 있습니다. 라자게스가 성공한다면 현신들이 아제로스를 혼란의 도가니에 빠뜨릴 것입니다.', 65727),
(2371, 'koKR', '주입의 동굴', '쿠로그 그림토템이 자신에게 대항하는 모든 이에게 파멸을 선사하고자 막강한 정령을 불러낼 준비를 하고 있습니다.', 65727),
(2370, 'koKR', '원시의 보루', '원시 의회가 산 내부에서 방어를 더욱더 견고하게 강화하고 있습니다. 현신의 해방을 저지하려면 원시술사의 전열을 무너뜨려야 합니다.', 65727),
(2358, 'koKR', '넬타루스', '', 65727),
(2354, 'koKR', '울다만: 티르의 유산', '', 65727),
(2352, 'koKR', '울다만: 티르의 유산', '', 65727),
(2348, 'koKR', '위대한 설계', '간수가 궁극적인 승리를 목전에 두고 있습니다. 그를 막지 못하면 온 우주가 조바알에게 복종하게 될 것입니다.', 65727),
(2347, 'koKR', '지배의 손아귀', '조바알의 강대한 추종자들은 수백만 개의 문명을 파괴해왔습니다. 결국 우주마저 그들의 손에 해체되는 운명을 맞이하고 말까요?', 65727),
(2346, 'koKR', '찰나의 터', '창조의 정수가 포식당하고 있습니다. 견제하지 않으면 현실이 붕괴할 것입니다.', 65727),
(2345, 'koKR', '창조의 주춧돌', '리후빔이 지배에 맞서 싸우고 있지만, 패색이 너무나 짙습니다. 그를 돕지 않으면 수호자의 힘은 간수의 것이 되어버릴 것입니다.', 65727),
(2344, 'koKR', '징벌', '실바나스 윈드러너가 탑의 꼭대기에서 기다립니다. 바로 이곳에서 우주의 명운을 건 마지막 대결이 펼쳐질 것입니다.', 65727),
(2343, 'koKR', '운명의 족쇄', '영혼의 강의 그 끝에는 탑 정상이 있습니다. 강의 힘을 갈취하는 자들을 처단하여 사후의 삶을 빼앗긴 무수히 많은 영혼을 해방해야 합니다.', 65727),
(2342, 'koKR', '암흑의 요새', '고통받는 자들의 비명은 곧 간수의 군대의 원동력과 같습니다. 이들의 괴로움을 끝내주고 나락의 가장 귀중한 자원을 없애버려야 합니다.', 65727),
(2341, 'koKR', '간수의 선봉대', '간수의 선봉대는 그 어떤 공격이든 격퇴할 준비가 되어 있습니다. 그의 성소에 돌입하려면 이들의 전선을 무너뜨려야 합니다.', 65727),
(2340, 'koKR', '교만과의 대면', '데나트리우스가 탑에서 영웅들이 도착하기만을 기다리고 있습니다. 레벤드레스의 운명을 놓고 결착을 지을 순간이 다가왔습니다.', 65727),
(2339, 'koKR', '돌의 선혈', '데나트리우스의 돌 군단 장군이 차분히 기다리며, 반란군을 완전히 궤멸할 덫을 준비하고 있습니다.', 65727),
(2338, 'koKR', '부유의 성물', '귀족들이 승리에 심취해 연회를 즐기는 지금, 영웅들이 난입해 그들을 권력에서 끌어내려야 합니다.', 65727),
(2337, 'koKR', '착취의 금고', '아물지 않은 상처에서 피가 흐르듯, 나스리아 성채의 금고에서 령이 새어 나오고 있습니다. 레벤드레스가 쇠진하기 전에 누출을 막아야 합니다.', 65727),
(2334, 'koKR', '하늘빛 보관소', '', 65727),
