INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2743, 'koKR', '금빛 폭풍의 천신', '|cFFFFD200게임 내 상점|r', '금빛 천둥으로 빛나는 존재이자, 운명에 선택받은 존재입니다. 황금빛 번개가 굽을 감싸 하늘을 찢어가르며 날아오르지요. 전승에 따르면 샤오하오 황제와 깊은 인연이 있다고 합니다.', 65727),
(2742, 'koKR', '천둥발굽의 천신', '|cFFFFD200게임 내 상점|r', '천둥왕이 쓰러진 뒤, 남은 천둥은 하얀 용의 영혼과 합쳐졌습니다. 이 존재는 푸른 번개를 딛고 달리며, 그 뒤로 구름이 소용돌이칩니다. 한때 폭정이 자리하던 곳에는 이제 수호자의 빛이 머무릅니다.', 65727),
(2798, 'koKR', '청동 무덤날개', '|cFFFFD200업적: |r격동하는 시간의 길 IV 정복자|n|cFFFFD200분류:|r 시간여행|n', '레벤드레스 주민들은 어둡고 음산한 걸 선호하지만, 그래도 눈부신 광채를 사랑하는 이들이 있습니다.', 65727),
(2797, 'koKR', '청동 시체파리', '|cFFFFD200업적: |r격동하는 시간의 길 IV 정복자|n|cFFFFD200분류:|r 시간여행', '시체파리를 꾸미려면 상당한 품이 들어갑니다. 그래도 혹자는 노력할 만한 보람이 있다고 한다네요.', 65727),
(2796, 'koKR', '청동 아퀼론', '|cFFFFD200업적: |r격동하는 시간의 길 IV 정복자|n|cFFFFD200분류:|r 시간여행|n|n', '승천의 보루의 믿음직한 준마들은 고결하고 당당한 전사, 승천자를 닮도록 만들어졌습니다.', 65727),
(2795, 'koKR', '청동 야생룡', '|cFFFFD200업적: |r격동하는 시간의 길 IV 정복자|n|cFFFFD200분류:|r 시간여행|n|n', '위엄 넘치는 야생룡은 하늘을 비틀며 날아오릅니다. 이들의 비행을 떠받치는 건 어떤 속박에도 매이지 않은 자유로운 마력입니다.', 65727),
(1729, 'koKR', '거물 미끈이', '|cFFFFD200퀘스트:|r 달팽이처럼|n|cFFFFD200지역: |r자랄레크 동굴', '큰마음과 큰 포부를 품고 있습니다. 그래서 거물이죠.', 65727);
