(146, 'koKR', '개척자의 터전', '넓은 농지와 절벽, 어두운 숲에 이르기까지 개척자의 터전은 얼라이언스와 친구들이 보금자리로 삼기에 완벽한 곳입니다.', 65727),
(145, 'koKR', '칼끝바람 해안', '푸른 오아시스에서부터 황금빛 단풍으로 물든 숲까지, 칼끝바람 해안은 호드와 친구들이 보금자리로 삼기에 완벽한 곳입니다.', 65727);
